import React from 'react';

class ShowButton extends React.Component {
  render() {
    const { show } = this.props;
    return(
      <div>      
        <div className="control">
        <button
          name="displayData"
          value={ true }
          className="button is-primary"
          onClick={ show }
        >
          Mostrar
        </button>
        </div>
      </div>
    )
  }
}

export default ShowButton;
